import Footer from './component/footer';
import Header from './component/header';

class About extends Component{
    componentWillMount() {
        fetch("http://localhost:3000/about").then(response => {
            return response.json()
          }).then( data => {
              if(data.states == 200){
                console.log("444")
              }else{
                console.log(data)
              }
          })
    }
    render() {
      return  <div>
      <Header></Header>
        <h3>我们是星际移民公司</h3>
      <Footer></Footer>
      </div>
    }
}

export default About;
